import { IField } from '../../types/form/field';
import { fieldTypeMap } from './form.variables';
import React from 'react';
interface IFormProps {
  fields: IField[];
}

export const Form = ({ fields }: IFormProps) => {
  return (
    <>
      {fields.map((field) => {
        const Input = fieldTypeMap.get(field.type);

        return <Input />;
      })}
    </>
  );
};
